import style from "./Form.module.css";

const Form = () =>{
    return(
        <Form>
            <div className={style.Container}>
                <label htmlFor="name:"></label>
                <input type="text" name="name"></input>
                <h3>aca vamos a crear el Form</h3>
            </div>
        </Form>
    )
}

export default Form;
